import React, { Component } from 'react';
import authService from '../api-authorization/AuthorizeService'
import usersService from '../users/UsersService';

    export class FetchProfil
    extends Component {
        static displayName = FetchProfil.name;

  constructor(props) {
    super(props);
      this.state = { user: null, loading: true };



            const { match } = this.props;
      this.userId = match.params.userId;
      console.log(this.userId)
        }

        componentDidMount() {
            this.retrieveFormData();
        }


  static renderForecastsTable(forecasts) {
    return (
      <table className='table table-striped' aria-labelledby="tabelLabel">
        <thead>
          <tr>
            <th>Date</th>
            <th>Temp. (C)</th>
            <th>Temp. (F)</th>
            <th>Summary</th>
          </tr>
        </thead>
        <tbody>
          {forecasts.map(forecast =>
              <tr key={forecast.id}>
              <td>{forecast.date}</td>
              <td>{forecast.temperatureC}</td>
              <td>{forecast.temperatureF}</td>
              <td>{forecast.summary}</td>
            </tr>
          )}
        </tbody>
      </table>
    );
  }

  render() {
    let contents = this.state.loading
      ? <p><em>Loading...</em></p>
      : FetchProfil.renderForecastsTable(this.state.forecasts);

    return (
      <div>
        <h1 id="tabelLabel" >Weather forecast</h1>
        <p>This component demonstrates fetching data from the server.</p>
        {contents}
      </div>
    );
  }


        async retrieveFormData() {
            const data = await usersService.getUserprofil("1");
            this.setState({ user: data, loading: false });
            console.log(data)
        }
}
